import { fetchAPI, initUrl } from '../services/fetchData';
import React, { useState, useEffect } from 'react';
function Details() {
  const { id } = useParams();
    const [character, setCharacter] = useState();
    const {name, image, species, gender, location, status} = 
  useEffect(() => {
    fetchAPI(`${initUrl}/${id}`)
      .then((data) => {
        setCharacter(data);
      })
      .catch((err) => {
        console.error(err);
      });
  }, []);

    return (
      <div className='details-container'>
            {character && <div className='details'
            />}
            <h1>{name}</h1>
            <img src={image} alt="character image" />
            <p>{species}</p>
            <p>{gender}</p>
        </div>
    );
}

export default Details;
